import React from 'react';
import './Form.css';

function Login() {
  return (
    <div className="form-container">
      <h1>로그인</h1>
      <form>
        <input type="text" placeholder="이메일" />
        <input type="password" placeholder="비밀번호" />
        <button type="submit">로그인</button>
      </form>
    </div>
  );
}

export default Login;
